import React from "react";
import "./bag.css";

function Bag({ games, reference }) {
  return (
    <section id="bag" className="bag" ref={reference}>
      <div className="container-fluid">
        <div className="row mb-3">
          <h1>My Bag</h1>
        </div>
      </div>
    </section>
  );
}

export default Bag;
